import React from "react";
import * as rb from "react-bootstrap";
import "./home.css";

class Home extends React.Component {
  render() {
    return (
      <div>
        <rb.Container>
          <ul className="flex-cols">
            <li className="department">
              <Card style={{ width: "18rem" }}>
                <Card.Img variant="top" src="./pictures/ae" />
                <Card.Body>
                  <Card.Title>Aeronautical Engineering</Card.Title>
                  <Button variant="primary">Click here</Button>
                </Card.Body>
              </Card>
            </li>
            <li>heloasdf</li>
          </ul>
        </rb.Container>
      </div>
    );
  }
}

export default Home;
